import React from 'react';
import Header from './components/Header.js';
import AboutMe from './components/AboutMe.js';
import {Route} from 'react-router-dom'; 
const App = () => {
  return(

      <div className = "App">
        <Header />
        <AboutMe />
            <Route exact path = "/" component = {AboutMe} />"
        </div>
  );
}
export default App;
